data:
  definition: matériel qui est immergé, ou dont les composants sont immergés, dans
    un liquide de protection et qui est ouvert à l'atmosphère externe
  examples: []
  notes:
  - Par exemple, un réservoir ouvert contenant des composants immergés en mouvement.
    Ce type de matériel comprend toute sorte de tuyauterie qui lui est associée.
